const CabinRegular = `@font-face { font-family: 'Cabin'; font-style: normal; font-weight: 400; src: local('Cabin'), local('Cabin-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const CabinItalic = `@font-face { font-family: 'Cabin'; font-style: italic; font-weight: 400; src: local('Cabin Italic'), local('Cabin-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
